import React, { Suspense } from 'react';
import { Route, Switch } from "react-router-dom";
import Auth from "../hoc/auth";

// pages for this product
import New from "./views/New/New.js";
import LoginPage from "./views/LoginPage/LoginPage.js";
import RegisterPage from "./views/RegisterPage/RegisterPage.js";
import NavBar from "./views/NavBar/NavBar";
import Footer from "./views/Footer/Footer"
import UploadProductPage from "./views/UploadProductPage/UploadProductPage.js"
import CartPage from "./views/CartPage/CartPage"

import Board from './views/Board/Board';
import Mypage from './views/Page/Mypage';
import Main from './views/Main/Main';
import './App.css';
import Categories from './views/Categories/Categories';
import DIY from './views/DIY/DIY';
import Bouquet from './views/Bouquet/Bouquet';
import Basket from './views/Basket/Basket';
import Special from './views/Special/Special';
import Pollen from './views/Pollen/Pollen';
import DIYClass1 from './views/DIY/DIYClass1';
import DIYClass2 from './views/DIY/DIYClass2';
import Basket1 from '../components/views/DetailProductpage/Basket1';
import Basket2 from '../components/views/DetailProductpage/Basket2';


function App() {
  return (
    <Suspense fallback={(<div>Loading...</div>)}>
      <NavBar />
      <Categories />
      <div style={{ paddingTop: '69px', minHeight: 'calc(100vh - 80px)' }}>
        <Switch>
          <Route exact path="/" component={Auth(Main, null)} />
          <Route exact path="/New" component={Auth(New, null)} />
          <Route exact path="/login" component={Auth(LoginPage, false)} />
          <Route exact path="/register" component={Auth(RegisterPage, false)} />
          <Route exact path="/product/upload" component={Auth(UploadProductPage, true)} />
          <Route exact path="/user/cart" component={Auth(CartPage, true)} />
          <Route exact path="/product/:productId" component={Auth(Basket1, null)} />

          <Route path="/Board" component={Board} />
          <Route path="/Mypage" component={Mypage} />
          <Route path="/DIY" component={DIY} />
          <Route path="/Bouquet" component={Bouquet} />
          <Route path="/Basket" component={Basket} />
          <Route path="/Special" component={Special} />
          <Route path="/Pollen" component={Pollen} />
          <Route path="/DIYClass1" component={DIYClass1} />
          <Route path="/DIYClass2" component={DIYClass2} />
          <Route path="/Basket2" component={Basket2} />
        </Switch>
      </div>
      <Footer />
    </Suspense>
  );
}

export default App;
